INSERT INTO thongbao () VALUES
('14', 'Thông báo tổ chức ngày Quốc tế thiếu nhi 1/6', '<p>Được sự tin tưởng giao ph&oacute; của ĐU bộ phận Odessa, BCH Hội người VN tỉnh Odessa, năm nay BCH Hội phụ nữ VN tỉnh Odessa sẽ tiếp tục chủ tr&igrave; tổ chức ng&agrave;y Quốc tế thiếu nhi 1/6 cho to&agrave;n thể c&aacute;c ch&aacute;u trong cộng đồng.&nbsp;<br />\nChương tr&igrave;nh sẽ bắt đầu&nbsp;<em><strong>v&agrave;o l&uacute;c 17h chủ nhật ng&agrave;y 31/5 tại Khu&ocirc;n vi&ecirc;n L&agrave;ng Sen.</strong></em>&nbsp;</p>\n', '<p>Được sự tin tưởng giao ph&oacute; của ĐU bộ phận Odessa, BCH Hội người VN tỉnh Odessa, năm nay BCH Hội phụ nữ VN tỉnh Odessa sẽ tiếp tục chủ tr&igrave; tổ chức ng&agrave;y Quốc tế thiếu nhi 1/6 cho to&agrave;n thể c&aacute;c ch&aacute;u trong cộng đồng.&nbsp;<br />\nChương tr&igrave;nh sẽ bắt đầu&nbsp;<em><strong>v&agrave;o l&uacute;c 17h chủ nhật ng&agrave;y 31/5 tại Khu&ocirc;n vi&ecirc;n L&agrave;ng Sen.</strong></em>&nbsp;<br />\nNội dung dự kiến gồm 2 phần:<br />\nPhần 1, Triển l&atilde;m c&aacute;c sản phẩm s&aacute;ng tạo của c&aacute;c ch&aacute;u thiếu nhi trong cộng đồng.&nbsp;<br />\nPhần 2, Li&ecirc;n hoan văn nghệ v&agrave; tr&ograve; chơi d&acirc;n gian</p>\n\n<p>Chi tiết xem trong file đ&iacute;nh k&egrave;m. Tr&acirc;n trọng!</p>\n', 'ngay1thang6.pdf', '98', '2016-11-15 16:05:00'),
('15', 'Thông báo nghỉ tết Bính Thân 2016', '<p>Ng&acirc;n h&agrave;ng nghỉ Tết từ Thứ Bảy 06.02.2016 (ng&agrave;y 28 Tết) đến hết&nbsp;Chủ nhật ng&agrave;y 14.02.2016 (m&ugrave;ng 7 Tết).</p>\n', '<p><img alt=\"\" src=\"/assets/kcfinder/upload/images/maivang.jpg\" style=\"height:380px; width:462px\" /></p>\n\n<p>Ng&acirc;n H&agrave;ng TMCP &Aacute; Ch&acirc;u tr&acirc;n trọng th&ocirc;ng b&aacute;o đến Qu&yacute; kh&aacute;ch về việc nghỉ tết B&iacute;nh Th&acirc;n 2016 như sau:</p>\n\n<p>Ng&acirc;n h&agrave;ng nghỉ Tết từ Thứ Bảy 06.02.2016 (ng&agrave;y 28 Tết) đến hết&nbsp;Chủ nhật ng&agrave;y 14.02.2016 (m&ugrave;ng 7 Tết).</p>\n\n<p>Thứ hai ng&agrave;y 15.02.2016 (m&ugrave;ng 8 Tết): Ng&acirc;n h&agrave;ng l&agrave;m việc trở lại như thường lệ.</p>\n\n<p>K&iacute;nh ch&uacute;c Qu&yacute; kh&aacute;ch năm mới An khang, Thịnh vượng, To&agrave;n ni&ecirc;n t&agrave;i ph&aacute;t.​</p>\n', 'thong-bao.pdf', '98', '2016-11-15 16:06:38'),
('16', 'Thông báo mời họp', '<p>Hội đồng quản trị C&ocirc;ng ty cổ phần Bia H&agrave; Nội &ndash; Hải Ph&ograve;ng xin tr&acirc;n trọng th&ocirc;ng b&aacute;o v&agrave; k&iacute;nh mời Qu&yacute; Cổ đ&ocirc;ng tham dự Đại hội cổ đ&ocirc;ng thường ni&ecirc;n năm 2011<br />\n<strong>1</strong>.&nbsp;<strong>Thời gian</strong>: 8h00 thứ Tư, ng&agrave;y 30 th&aacute;ng 03 năm 2011<br />\n<strong>2. Địa điểm</strong>: Ph&ograve;ng 302, tầng 3, Trung t&acirc;m Hội nghị TP. Hải Ph&ograve;ng &ndash; số 18 Ho&agrave;ng Diệu &ndash; Hồng B&agrave;ng &ndash; HP</p>\n', '<p><strong>C&Ocirc;NG TY CỔ PHẦN BIA H&Agrave; NỘI &ndash; HẢI PH&Ograve;NG</strong></p>\n\n<p><strong>Địa chỉ: SỐ 16 LẠCH TRAY, NG&Ocirc; QUYỀN, HẢI PH&Ograve;NG</strong></p>\n\n<p><strong>Điện thoại: 031.3 847 004&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; Fax: 031.3 845 157</strong></p>\n\n<p>&nbsp;</p>\n\n<p style=\"text-align: center;\"><strong>TH&Ocirc;NG B&Aacute;O MỜI HỌP</strong><br />\n<strong>Đại hội đồng cổ đ&ocirc;ng thường ni&ecirc;n năm 2011</strong><br />\n&nbsp;</p>\n\n<p><strong>K&iacute;nh gửi:</strong>&nbsp;<strong>Qu&yacute; Cổ đ&ocirc;ng</strong></p>\n\n<p>Hội đồng quản trị C&ocirc;ng ty cổ phần Bia H&agrave; Nội &ndash; Hải Ph&ograve;ng xin tr&acirc;n trọng th&ocirc;ng b&aacute;o v&agrave; k&iacute;nh mời Qu&yacute; Cổ đ&ocirc;ng tham dự Đại hội cổ đ&ocirc;ng thường ni&ecirc;n năm 2011<br />\n<strong>1</strong>.&nbsp;<strong>Thời gian</strong>: 8h00 thứ Tư, ng&agrave;y 30 th&aacute;ng 03 năm 2011<br />\n<strong>2. Địa điểm</strong>: Ph&ograve;ng 302, tầng 3, Trung t&acirc;m Hội nghị TP. Hải Ph&ograve;ng &ndash; số 18 Ho&agrave;ng Diệu &ndash; Hồng B&agrave;ng &ndash; HP</p>\n\n<p><strong>3. Nội dung Đại hội</strong>:<br />\n- B&aacute;o c&aacute;o kết quả hoạt động sản xuất, kinh doanh của C&ocirc;ng ty năm 2010, kế hoạch sản xuất, kinh doanh v&agrave; đầu tư năm 2011;<br />\n- B&aacute;o c&aacute;o t&agrave;i ch&iacute;nh năm 2010 đ&atilde; được kiểm to&aacute;n;<br />\n- Th&ocirc;ng qua phương &aacute;n ph&acirc;n phối lợi nhuận, tr&iacute;ch lập c&aacute;c quỹ, chia cổ tức năm 2010 v&agrave; kế hoạch năm 2011. Mức th&ugrave; lao HĐQT, BKS năm 2011;<br />\n- C&aacute;c vấn đề kh&aacute;c<br />\n<strong>4. Điều kiện tham dự:</strong><br />\n- C&aacute;c cổ đ&ocirc;ng c&oacute; t&ecirc;n trong danh s&aacute;ch sở hữu cổ phần của C&ocirc;ng ty cổ phần Bia H&agrave; Nội &ndash; Hải Ph&ograve;ng ng&agrave;y 26/08/2010.</p>\n\n<p><strong>Lưu &yacute;:</strong></p>\n\n<p>- Qu&yacute; cổ đ&ocirc;ng đến tham dự Đại hội mang theo Giấy mời v&agrave; CMND.</p>\n\n<p>- Những cổ đ&ocirc;ng kh&ocirc;ng tham dự Đại hội c&oacute; thể uỷ quyền cho người kh&aacute;c tham dự (mẫu giấy uỷ quyền gửi k&egrave;m theo Giấy mời họp). Thời hạn nộp giấy ủy quyền trước&nbsp;<strong>17h00 ng&agrave;y 26/03/2011</strong>&nbsp;tại Ph&ograve;ng Tổng hợp &ndash; C&ocirc;ng ty cổ phần Bia H&agrave; Nội &ndash; Hải Ph&ograve;ng</p>\n\n<p>Điện thoại: 031. 3 853 680</p>\n\n<p><em>Th&ocirc;ng b&aacute;o n&agrave;y thay cho Giấy mời họp trong trường hợp Qu&yacute; Cổ đ&ocirc;ng chưa nhận được Giấy mời họp</em><br />\n<strong><em>Tr&acirc;n trọng./.</em></strong></p>\n\n<p><strong>TM.HỘI ĐỒNG QUẢN TRỊ</strong><br />\n<strong><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CHỦ TỊCH&nbsp;</strong><br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(Đ&atilde; k&yacute;)</strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><br />\n<strong><strong><em>&nbsp; Nguyễn Tuấn Phong</em></strong></strong></p>\n', NULL, '98', '2016-11-15 16:08:58'),
('17', 'Thông báo, bổ nhiệm Phó Tổng Giám Đốc', '<p>C&ocirc;ng ty xin th&ocirc;ng b&aacute;o với to&agrave;n thể nh&acirc;n vi&ecirc;n&nbsp;về việc bổ nhiệm Ph&oacute; Tổng gi&aacute;m đốc mới của c&ocirc;ng ty&nbsp;đối với &ocirc;ng Đặng Đức Ho&agrave;n.</p>\n', '<p>C&ocirc;ng ty xin th&ocirc;ng b&aacute;o với to&agrave;n thể nh&acirc;n vi&ecirc;n&nbsp;về việc bổ nhiệm Ph&oacute; Tổng gi&aacute;m đốc mới của c&ocirc;ng ty&nbsp;đối với &ocirc;ng Đặng Đức Ho&agrave;n.</p>\n\n<p>Th&ocirc;ng tin chi tiết xin vui l&ograve;ng xem tin file đ&iacute;nh k&egrave;m.</p>\n\n<p>Tr&acirc;n trọng cảm ơn.</p>\n', 'quyet-dinh-bo-nhiem-pho-tgd-ncts.pdf', '98', '2016-11-15 16:10:15'),
('18', 'Thông báo nghỉ lễ 30/4 và 1/5', '<p>Xem chi tiết trong th&ocirc;ng b&aacute;o</p>\n', '<p><strong>Giỗ tổ H&ugrave;ng Vương:&nbsp;</strong></p>\n\n<p>Văn ph&ograve;ng sẽ nghỉ từ ng&agrave;y 16/4/2016 đến ng&agrave;y 18/4/2016.&nbsp;</p>\n\n<p>Ng&agrave;y 19/4/2016 văn ph&ograve;ng l&agrave;m việc b&igrave;nh thường trở lại.</p>\n\n<p><strong>Ng&agrave;y Thống nhất Đất nước 30/4 v&agrave; Quốc tế Lao động 1/5:</strong></p>\n\n<p>Văn ph&ograve;ng sẽ nghỉ từ ng&agrave;y 30/4/2016 đến ng&agrave;y 3/5/2016.&nbsp;<br />\nNg&agrave;y 4/5/2016 văn ph&ograve;ng l&agrave;m việc b&igrave;nh thường trở lại.</p>\n', NULL, '98', '2016-11-15 16:12:30'),
('19', 'Quyết định về việc tăng lương cho toàn thể nhân viên trong công ty theo qui định của nhà nước.', '<p>Chi tiết xem trong file đ&iacute;nh k&egrave;m.</p>\n', '<p>Chi tiết xem trong file đ&iacute;nh k&egrave;m.</p>\n', '122.signed.pdf', '98', '2016-11-15 16:13:33'),
('20', 'New notify', '<p>M&ocirc; tả</p>\n', '<p>Nội dung</p>\n', NULL, '98', '2016-11-29 11:17:43'),
('22', 'Demo thông nhận thông báo mới', '<p>M&ocirc; tả cho th&ocirc;ng b&aacute;o mới</p>\r\n', '<p>Nội dung th&ocirc;ng b&aacute;o</p>\r\n', NULL, '98', '2016-12-04 16:47:27');endLine
